INSERT INTO card (id, abilities, cmc, cost, name, other_side_id, power, subtype, supertype, toughness, type, status_id) VALUES (1671, 'Haste <i>(This creature can attack and {tap} as soon as it comes under your control.)</i>$Exalted <i>(Whenever a creature you control attacks alone, that creature gets +1/+1 until end of turn.)</i>', 4, '3$B', 'Duskmantle Prowler', NULL, '2', 'Vampire Rogue', NULL, '2', 'Creature', 1670);
